import React, { Component } from "react";

export default class talentTable extends Component {
  state = {
    level: 1,
    talent: 0,
    selected: false
  };

  // Function for getting random talents
  getRandomTalents = e => {
    e.preventDefault();
    const { talent } = this.state;
    this.setState({
      talent: Math.floor(Math.random() * (1 - 4)) + 4
    });
  };

  render() {
    return (
      <button
        type="button"
        className="btn btn-primary"
        onClick={this.getRandomTalents}
      >
        Start
      </button>
    );
  }
}
